webpackJsonp([166677412003685e5],{"./node_modules/json-loader/index.js!./.cache/json/certificates-golf-code.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/triangular_flag_on_post.png?v=3" title=":triangular_flag_on_post:" alt=":triangular_flag_on_post:" class="forum-image"> Remember to use <a><strong><code>Read-Search-Ask</code></strong></a> if you get stuck. Try to pair program <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/busts_in_silhouette.png?v=3" title=":busts_in_silhouette:" alt=":busts_in_silhouette:" class="forum-image"> and write your own code <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/pencil.png?v=3" title=":pencil:" alt=":pencil:" class="forum-image"></p>\n<h3><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/checkered_flag.png?v=3" title=":checkered_flag:" alt=":checkered_flag:" class="forum-image"> Problem Explanation:</h3>\n<p>In the game of golf each hole has a <strong>par</strong> meaning the average number of <strong>strokes</strong> a golfer is expected to make in order to sink the ball in a hole to complete the play. Depending on how far above or below <strong>par</strong> your <strong>strokes</strong> are, there is a different nickname.</p>\n<p>Your function will be passed <strong>par</strong> and <strong>strokes</strong> arguments. You’ve to return the correct string according to this table which lists the strokes in order of priority; top (highest) to bottom (lowest):</p>\n<table>\n<thead>\n<tr>\n<th align="left">Strokes</th>\n<th align="left">Return</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align="left">1</td>\n<td align="left">“Hole-in-one!”</td>\n</tr>\n<tr>\n<td align="left">&#x3C;= par - 2</td>\n<td align="left">“Eagle”</td>\n</tr>\n<tr>\n<td align="left">par - 1</td>\n<td align="left">“Birdie”</td>\n</tr>\n<tr>\n<td align="left">par</td>\n<td align="left">“Par”</td>\n</tr>\n<tr>\n<td align="left">par + 1</td>\n<td align="left">“Bogey”</td>\n</tr>\n<tr>\n<td align="left">par + 2</td>\n<td align="left">“Double Bogey”</td>\n</tr>\n</tbody>\n</table>\n<blockquote>\n<p>= par + 3 | “Go Home!”</p>\n</blockquote>\n<p><strong>par</strong> and <strong>strokes</strong> will always be numeric and positive.</p>\n<ul>\n<li>Change the code below <code>// Only change code below this line</code> and above <code>// Only change code above this line</code>.</li>\n<li>Ensure that you’re editing the inside of the <code>golfScore</code> function.</li>\n<li>You will have to make the function return exactly the same string as shown shown in the table, depending on the value of the parameters <strong>par</strong> and <strong>strokes</strong> that are passed to your function.</li>\n</ul>\n<h4>Relevant Links</h4>\n<ul>\n<li><a href=\'https://en.wikipedia.org/wiki/Golf\' target=\'_blank\' rel=\'nofollow\'>Golf</a></li>\n<li><a href=\'http://www.freecodecamp.com/challenges/chaining-if-else-statements\' target=\'_blank\' rel=\'nofollow\'>Challenge: Chaining If Else Statements</a></li>\n<li><a href=\'http://www.freecodecamp.com/challenges/comparison-with-the-greater-than-equal-to-operator\' target=\'_blank\' rel=\'nofollow\'>Challenge: Comparison with the Greater Than Equal To Operator</a></li>\n<li><a href=\'http://www.freecodecamp.com/challenges/comparison-with-the-less-than-equal-to-operator\' target=\'_blank\' rel=\'nofollow\'>Challenge: Comparison with the Less Than Equal To Operator</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" title=":speech_balloon:" alt=":speech_balloon:" class="forum-image"> Hint: 1</h2>\n<p><code>+number -number</code> can be used to increase or decrease a parameter in your condition.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" title=":speech_balloon:" alt=":speech_balloon:" class="forum-image"> Hint: 2</h2>\n<p>You use <code>if / else if</code> chains to return different values in different scenarios.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" title=":speech_balloon:" alt=":speech_balloon:" class="forum-image"> Hint: 3</h2>\n<p>Control the flow of your function based on the tables order of priority - top (highest) to bottom (lowest) to return matching string values.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2>Spoiler Alert!</h2>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/2/2d6c412a50797771301e7ceabd554cef4edcd74d.gif" alt="warning sign"></p>\n<p><strong>Solution ahead!</strong></p>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/beginner.png?v=3" title=":beginner:" alt=":beginner:" class="forum-image"> Basic Code Solution:</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>function golfScore(par, strokes) {\n  // Only change code below this line\n  if (strokes == 1){\n    return "Hole-in-one!";\n  } else if (strokes <= par -2){\n    return "Eagle";\n  } else if (strokes == par -1) {\n    return "Birdie";\n  } else if (strokes == par) {\n    return "Par";\n  } else if (strokes == par +1) {\n    return "Bogey";\n  } else if (strokes == par +2) {\n    return "Double Bogey";\n  } else {\n    return "Go Home!";\n  }\n  // Only change code above this line\n}\n// Change these values to test\ngolfScore(5, 4);</code></pre>\n      </div>\n<h3>Code Explanation:</h3>\n<ul>\n<li>Compare the parameters <strong>par</strong> and <strong>strokes</strong> to return appropriate string values.</li>\n<li><code>if / else if</code> chain is used for flow control.</li>\n<li>String “Go Home!” is returned for every condition where <strong>strokes</strong> is greater than or equal to <strong>par + 3</strong>.</li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/clipboard.png?v=3" title=":clipboard:" alt=":clipboard:" class="forum-image"> NOTES FOR CONTRIBUTIONS:</h2>\n<ul>\n<li><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" title=":warning:" alt=":warning:" class="forum-image"> <strong>DO NOT</strong> add solutions that are similar to any existing solutions. If you think it is <strong><em>similar but better</em></strong>, then try to merge (or replace) the existing similar solution.</li>\n<li>Add an explanation of your solution.</li>\n<li>Categorize the solution in one of the following categories — <strong>Basic</strong>, <strong>Intermediate</strong> and <strong>Advanced</strong>. <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/traffic_light.png?v=3" title=":traffic_light:" alt=":traffic_light:" class="forum-image"></li>\n<li>Please add your username only if you have added any <strong>relevant main contents</strong>. (<img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" title=":warning:" alt=":warning:" class="forum-image"> <strong><em>DO NOT</em></strong> <em>remove any existing usernames</em>)</li>\n</ul>\n<blockquote>\n<p>See <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/point_right.png?v=3" title=":point_right:" alt=":point_right:" class="forum-image"> <a href=\'http://forum.freecodecamp.com/t/algorithm-article-template/14272\' target=\'_blank\' rel=\'nofollow\'><strong><code>Wiki Challenge Solution Template</code></strong></a> for reference.</p>\n</blockquote>',fields:{slug:"/certificates/golf-code/"},frontmatter:{title:"Golf Code"}}},pathContext:{slug:"/certificates/golf-code/"}}}});
